import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href="" className="logo">MyBlog</a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
          <div className="entry">
            <img src="https://ww.gimmesomeoven.com/wp-content/uploads/2016/03/Screen-Shot-2016-03-21-at-11.54.10-AM-e1458579456751.png" alt="" />
            <h2></h2>
          </div>

      </header>
    </main>
  );
}

export default App;
